<!DOCTYPE html>
<html lang="zh-Hant">
<head>
    <meta charset="UTF-8">
    <title>牙齒組狀態管理</title>
    <style>
        .cavity { fill: #FF0000; }     
        .missing { fill: #000000; }    
        .broken { fill: #808080; }    
        .filled { fill: #FFFF00; }     
        .crown { fill: #0000FF; }      
        .transparent { fill: transparent; } 

        body {
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
        }

        .container {
            width: 80%;
            max-width: 885px;
            margin: 0 auto;
            text-align: center;
        }

        table {
            margin: 20px auto; 
        }
    </style>
    <script>
        // 上顎牙齒組列表
        const toothGroupsUpper = ['18', '17', '16', '15', '14', '13', '12', '11' ,'21', '22', '23', '24', '25', '26', '27', '28'];
        // 下顎牙齒組列表
        const toothGroupsLower = ['38', '37', '36', '35', '34', '33', '32', '31' ,'41', '42', '43', '44', '45', '46', '47', '48'];
        // 狀態選項列表
        const statuses = [
            {value: 'complete', text: '完整'},
            {value: 'cavity', text: '蛀牙'},
            {value: 'missing', text: '缺牙'},
            {value: 'broken', text: '斷牙'},
            {value: 'filled', text: '補牙'},
            {value: 'crown', text: '牙套'}
        ];

        function changeToothStatus(toothGroup, status) {
            const group = document.querySelectorAll(`.${toothGroup} path`);
            group.forEach(element => {
                element.className.baseVal = status;
            });
        }

        // 動態生成狀態選擇框
        function generateSelect(toothGroup) {
            const select = document.createElement('select');
            select.onchange = function() {
                changeToothStatus(`tooth-group${toothGroup}`, this.value);
            };

            statuses.forEach(status => {
                const option = document.createElement('option');
                option.value = status.value;
                option.textContent = status.text;
                select.appendChild(option);
            });

            const td = document.createElement('td');
            td.appendChild(select);
            return td;
        }

        // 動態生成表格
        function generateTable(toothGroups, tableHeadRowId, tableBodyId) {
            const tableHeadRow = document.getElementById(tableHeadRowId);
            const tableBody = document.getElementById(tableBodyId);

            // 清空表頭和表體的內容
            tableHeadRow.innerHTML = '';
            tableBody.innerHTML = '';

            const statusRow = document.createElement('tr');

            toothGroups.forEach(group => {
                // 表頭添加牙齒組
                const th = document.createElement('th');
                th.textContent = `${group}`;
                tableHeadRow.appendChild(th);

                // 表體添加選擇框
                const td = generateSelect(group);
                statusRow.appendChild(td);
            });

            tableBody.appendChild(statusRow);
        }

    

        // 頁面加載完成後生成表格和SVG
        window.onload = function() {
            // 生成上顎牙齒的表格和SVG
            generateTable(toothGroupsUpper, 'table-head-row-upper', 'table-body-upper');

            // 生成下顎牙齒的表格和SVG
            generateTable(toothGroupsLower, 'table-head-row-lower', 'table-body-lower');
        };
    </script>
</head>
